        public static void W_DeepMMO_Protocol_Response(IOutputStream output, object msg)
        {
            var data = (DeepMMO.Protocol.Response)msg;
                        
            output.PutS32(data.s2c_code);
            output.PutUTF(data.s2c_msg);
            
            
        }
        public static void R_DeepMMO_Protocol_Response(IInputStream input, object msg)
        {
            var data = (DeepMMO.Protocol.Response)msg;
                        
            data.s2c_code = input.GetS32();
            data.s2c_msg = input.GetUTF();
            
            
        }      
    }
